function NavBar(){
    return(
        <nav>
            <div className="logo">
                <h1>TYLER</h1>
                <ulnav className="nav-items">
                    <li><a href="">HOME</a></li>
                    <li><a href="">ABOUT</a></li>
                    <li><a href="">PROJECTS</a></li>
                </ulnav>
            </div>
        </nav>
    )
}
export default NavBar;
